{
	int status;
	
	status = 0;
	
	if (argc > 1)
		testonly = (int)strtol(argv[1], NULL, 0);
	
	set_precision(FPCR_PRECISION_EXTENDED);
	set_rounding(FPCR_ROUND_NEAR);
	
#ifdef TEST_OP_F_F
	status |= test_table_f_ff_func(fatan2_data, ARRAY_SIZE(fatan2_data), __FILE__);
#endif
#ifdef TEST_FUNC_F_F
	status |= test_table_f_ff_func(fatan2_data, ARRAY_SIZE(fatan2_data), __FILE__);
#endif
	
	return status ? EXIT_FAILURE : EXIT_SUCCESS;
}
